import Navbar from './Navbar/Navbar';
import Footer from './Footer/Footer';
import Registration from './Registration/Registration';
import { Route, Routes } from 'react-router-dom';
import React, { Suspense } from 'react';
import Error from './Error/Error';
import Window from '../../HOC/Window/window';
import Olimpiad from '../Olimpiad/Olimpiad';
import { useState } from 'react';
import s from './Home.module.css';


const Home = () => {

    let [SelectedItem, SetSelectedItem] = useState([0,0,0,0,0,0]);
    let [ColapsItem, SetColapsItem] = useState([0,1,1,0,0,0]);
    let [MainEl, SetMainEl] = useState(-1);
    console.log(SelectedItem)

    return (
        <div>
            <Navbar SelectedItem={ SelectedItem } SetSelectedItem={ SetSelectedItem }/>
            <Footer />
            { SelectedItem[0] === 1 ? <Olimpiad onClick={ () => { SetMainEl(0) }} 
                                        className={s.Olimpiad} SetColapsItem = { SetColapsItem } 
                                        ColapsItem={ ColapsItem } Id={0} SelectedItem={ SelectedItem } 
                                        SetSelectedItem={ SetSelectedItem }/>
                                        : <></> }
            { SelectedItem[1] === 1 ? <Error onClick={ () => { SetMainEl(1) }} 
                                        className={s.Error} ColapsItem={ ColapsItem } 
                                        Id={1} SelectedItem={ SelectedItem } SetSelectedItem={ SetSelectedItem } 
                                        Text={'Warning: Объект переполнен...'}/>
                                        : <></> }
            { SelectedItem[2] === 1 ? <Registration /> : <></> }
            <Suspense fallback={<div>Loading...</div>}>
                <Routes>
                    <Route path='/Registration' element={<Registration />}/>
                    <Route path='/Error' element={<Error Text={'Warning: Объект переполнен...'}/>}/>
                </Routes>
            </Suspense>
        </div>
    );
}


export default Home;
